drop table tr_temp purge;
drop SEQUENCE SEQ;

CREATE TABLE TR_TEMP AS
SELECT 
MIN(C.ID) CELL_ID
,A.CELL
,A.STATION
,A.JOINT_NUMBER
,'SILICONE' SEALANT_TYPE
--,A.OFFSET,A.ELEV,A.EASTING,A.NORTHING
,A.DATE_UPDATED 
FROM ASBUILT_JOINTS A JOIN CELL C ON C.CELL_NUMBER=A.CELL
WHERE ABS(A.OFFSET) < 1 AND CELL IS NOT NULL
GROUP BY A.CELL
,A.STATION
,A.JOINT_NUMBER
--,A.OFFSET,A.ELEV,A.EASTING,A.NORTHING
,A.DATE_UPDATED
ORDER BY A.CELL
,A.STATION
,A.JOINT_NUMBER
--,A.OFFSET,A.ELEV,A.EASTING,A.NORTHING
,A.DATE_UPDATED;
DROP TABLE TRANSVERSE_JOINT PURGE;
CREATE SEQUENCE SEQ MINVALUE 1 START WITH 1 INCREMENT BY 1 CACHE 20;
CREATE TABLE TRANSVERSE_JOINT AS
SELECT T.*
, SEQ.NEXTVAL AS ID
FROM TR_TEMP T;
